import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [fileContent, setFileContent] = useState('');

  useEffect(() => {
    axios.get('./planets.txt')
      .then(response => setFileContent(response.data))
      .catch(error => console.log(error));
  }, []);

  return (
    <div>
      <p>{fileContent}</p>
    </div>
  );
}

export default App;
